import React, { Component } from "react";

class CreateMovie extends Component {
  constructor() {
    super();
    this.state = {
      discover: {}
    };
  }

  componentDidMount() {
    // const res = await fetch("http://localhost:5000/discover/");
    // this.setState({discover: res.json()});
    fetch("http://localhost:5000/discover/")
      .then(response => response.json())
      .then(data => this.setState({ discover: data }));
  }

  // testFunc = () => {
  //   console.log(Object.keys(this.state.discover));
  // };

  render() {
    return (
      <div>
        <p>Content: Discover page for new movies</p>
        <p>{this.state.discover[0].title}</p>
      </div>
    );
  }
}

export default CreateMovie;
